import styled from 'styled-components';

export const Container = styled.div`
  height: 100vh;
  display: flex;
`;

export const Content = styled.div``;

export const Nav = styled.nav`
  background: #373737;
  color: #fff;
  height: 50px;
  flex: 1;

  ul {
    justify-content: center;

    strong {
      font-size: 18px;
      font-weight: 300;
    }
  }

  li {
    display: inline;
  }
`;
